import React from 'react';
import './App.css';


const App = () => {
  return (
    <div className='app-wrapper'>
      <header className='header'>
        <img src='https://www.appmachine.com/wp-content/uploads/2016/02/No-Branding-Header-Background-1.jpg'></img>  
      </header>    
      <nav className='nav'>
        <div>Profile</div>
        <div>Messages</div>
        <div>News</div>
        <div>Music</div>
      </nav>
      <div className='content'>Main content</div>
      </div>
  );
}

export default App;
